CREATE TABLE users (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	inserted_at TIMESTAMP NOT NULL DEFAULT now(),
	userhash STRING NOT NULL,
	roles STRING[] NULL DEFAULT ARRAY[],
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX users_userhash_key (userhash ASC),
	FAMILY "primary" (id, inserted_at, userhash, roles)
);

CREATE TABLE spots (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	informer_id UUID NOT NULL,
	inserted_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	informed_at INT NOT NULL,
	azimuth FLOAT NOT NULL,
	altitude FLOAT NOT NULL,
	longitude FLOAT NOT NULL,
	latitude FLOAT NOT NULL,
	client_at INT NOT NULL,
	quantity INT NULL DEFAULT 0:::INT,
	mode INT NULL DEFAULT 0:::INT,
	direction INT[] NULL DEFAULT NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	CONSTRAINT fk_informer_id_ref_users FOREIGN KEY (informer_id) REFERENCES users (id),
	INDEX spots_auto_index_fk_informer_id_ref_users (informer_id ASC),
	FAMILY "primary" (id, informer_id, inserted_at, informed_at, azimuth, altitude, longitude, latitude, client_at, quantity, mode, direction)
);

CREATE TABLE occupy (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	spot_id UUID NOT NULL,
	inserted_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	taken_at TIMESTAMP NULL,
	taker_id UUID NULL,
	client_at INT NOT NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	CONSTRAINT fk_spot_id_ref_spots FOREIGN KEY (spot_id) REFERENCES spots (id),
	INDEX occupy_auto_index_fk_spot_id_ref_spots (spot_id ASC),
	CONSTRAINT fk_taker_id_ref_users FOREIGN KEY (taker_id) REFERENCES users (id),
	INDEX occupy_auto_index_fk_taker_id_ref_users (taker_id ASC),
	FAMILY "primary" (id, spot_id, inserted_at, taken_at, taker_id, client_at)
);

CREATE TABLE parked (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	informer_id UUID NOT NULL,
	inserted_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	informed_at INT NOT NULL,
	azimuth FLOAT NOT NULL,
	altitude FLOAT NOT NULL,
	longitude FLOAT NOT NULL,
	latitude FLOAT NOT NULL,
	client_at INT NOT NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	CONSTRAINT fk_informer_id_ref_users FOREIGN KEY (informer_id) REFERENCES users (id),
	INDEX parked_auto_index_fk_informer_id_ref_users (informer_id ASC),
	FAMILY "primary" (id, informer_id, inserted_at, informed_at, azimuth, altitude, longitude, latitude, client_at)
);

CREATE TABLE spotsfloat (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	informer_id UUID NOT NULL,
	inserted_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	informed_at INT NOT NULL,
	taken_at TIMESTAMP NULL,
	taker_id UUID NULL,
	azimuth FLOAT NOT NULL,
	altitude FLOAT NOT NULL,
	longitude FLOAT NOT NULL,
	latitude FLOAT NOT NULL,
	spot INT NOT NULL,
	compaint STRING NULL,
	client_at INT NOT NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	CONSTRAINT fk_informer_id_ref_users FOREIGN KEY (informer_id) REFERENCES users (id),
	INDEX spotsfloat_auto_index_fk_informer_id_ref_users (informer_id ASC),
	CONSTRAINT fk_taker_id_ref_users FOREIGN KEY (taker_id) REFERENCES users (id),
	INDEX spotsfloat_auto_index_fk_taker_id_ref_users (taker_id ASC),
	FAMILY "primary" (id, informer_id, inserted_at, informed_at, taken_at, taker_id, azimuth, altitude, longitude, latitude, spot, compaint, client_at)
);

























